    mintFee = _mintFee * 10**15;
    emit NewMintFee(mintFee);
  }

  function setPaymentAddresses(address _fifty, address _thirty) public onlyOwner {
    crypTardsOne = _fifty;
    crypTardsTwo = _thirty;
  }

